import React from "react";
import LargeButton from "./LargeButton";
import Title from "./Title";
import InputField from "./InputField";
import PhoneImage from "./PhoneImage";
import Footer from "./Footer";
import {withRouter} from 'react-router-dom';
import "bootstrap";

class Home extends React.Component {
    constructor() {
        super();
        this.state = {

        }
        
        this.handleClickLogIn = this.handleClickLogIn.bind(this);
    }
    handleClickRegistration() {
        
    }
    handleClickLogIn() {
    }
    nextPath(path) {
        this.props.history.push(path);
      }    
    render() {
        return (
            <div>
                <div className="container-fluid" >
                    <div className="row justify-content-center">
                        <Title
                            fontSize="140px"
                            fontWeight="lighter"
                            color="#666666"
                            text="#TECH"
                        />
                    </div>
                    <div className="row justify-content-center">
                        <Title
                            fontSize="40px"
                            fontWeight="lighter"
                            color="#b2b2b2"
                            text="New thinking. New #tech."
                        />
                    </div>
                    <div className="row">
                        <div style={{ visibility: "hidden", fontSize: "30px" }}>d</div>
                    </div>
                    <div className="row">
                        <div className="col-lg-6 col-md-12 col-sm-12 col-xs-12 ">
                            <div className="d-flex justify-content-center" >
                                <PhoneImage style={{ width: "550px", height: "600px" }} />
                            </div>
                        </div>
                        <div className="col-lg-6 col-md-12 col-sm-12 col-xs-12 d-flex flex-row align-items-lg-center align-items-md-stretch">
                            <div className="col align-items-center my-md-5 my-sm-5 my-xs-5">

                                <div className="d-flex justify-content-center" >
                                    <Title
                                        fontSize="50px"
                                        fontWeight="bold"
                                        color="#666666"
                                        text="W E L C O M E"
                                    />
                                </div>
                                <div className="d-flex justify-content-center">
                                    <InputField type="text" placeholder="Email"
                                        style={{
                                            marginTop: "10px",
                                            width: "450px",
                                            height: "50px",
                                            color: "#434343",
                                            fontFamily: "-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif",
                                            fontEeight: "lighter",
                                            border: "1px solid #dddddd"
                                        }} />
                                </div>
                                <div className="d-flex justify-content-center">
                                    <InputField type="password" placeholder="Password"
                                        style={{
                                            marginTop: "20px",
                                            width: "450px",
                                            height: "50px",
                                            color: "#434343",
                                            fontFamily: "-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif",
                                            fontEeight: "lighter",
                                            border: "1px solid #dddddd"
                                        }} />
                                </div>
                                <div className="d-flex justify-content-center">
                                    <a href={() => this.nextPath('/register')} style={{ marginTop: "10px" }}>New user? Register here.</a>
                                </div>
                                <div className="d-flex justify-content-center">
                                    <LargeButton
                                        value="LOG IN"
                                        style={{
                                            width: "200px",
                                            height: "50px",
                                            borderRadius: "10px",
                                            backgroundColor: "#2d2d2d",
                                            borderColor: "#2d2d2d",
                                            fontSize: "20px",
                                            color: "white"
                                            
                                        }}
                                        handleClick={this.handleClickLogIn}
                                    />
                                </div>
                            </div>
                        </div>
                     </div>
                </div>
                
               <Footer/>
            </div>
            );
    } 
}
export default Home;
